              id: "40709924",
              title: '"What is this place?"',
              slug: "painting-that-never-dries",
              info: '<h3>One day a man walked into a place &ndash; the air warm, the scent sweet &ndash;</h3>\n<h4><em>&ldquo;I want a room&rdquo;</em>, thought he, <em>&ldquo;to rest&rdquo;.</em></h4>\n<h4><em>&ldquo;Certainly my dear&rdquo;</em>, he was told, <em>&ldquo;you have a choice of eight&rdquo;.</em></h4>\n<h4><em>&ldquo;You lie&rdquo;, said he &hellip; on counting he saw only six.</em></h4>\n<h4><em>&ldquo;Ah yes, but eight rhymes with cake&rdquo;.</em></h4>\n<h4><em>&ldquo;Okay&rdquo;, said he, &ldquo;what shall I find?&rdquo;</em></h4>\n<h4><em>&ldquo;Well&rdquo;</em>, said the voice,<em> &ldquo;if you are very hungry and have coins in your pocket, ascend the stairs and you will find a dining hall of such magnificence, it will so take your breath away that your face will be a certain hue&rdquo;.</em></h4>\n<h4><em>&ldquo;Gosh&rdquo;</em>, thought he, checking his pockets and his complexion in a mirror, <em>&ldquo;what else do you have?&rdquo;</em></h4>\n<h4><em>&ldquo;There is a bar ranked with chairs of every discernible shape&hellip; once is bound to suit&hellip; and gentlemen behind the bar who will mix a beverage so fair to help soothe the most pained head&rdquo;.</em></h4>\n<h4>As the man savoured and savoured some more, the voice again came to his head,</h4>\n<h4><em>&ldquo;There is a gallery of projected art in a room so clean and rare while the sun is up, which at night, at 7, becomes a brasserie of light."</em></h4>\n<h4><em>"Food of all kinds passes the table where you sit, to be picked and chosen for your heart&rsquo;s desire."</em></h4>\n<h4><em>"As the midnight hour approaches, tables and chairs are brushed away to allow movement and dance that comes when music infuses the room.</em></h4>\n<h4><em>"Come, sir, another night in the same image you would not see&rdquo;.</em></h4>\n<h4>As the man&rsquo;s thoughts wandered in and out of this head, one trickled out of his ear, never to be thought again.</h4>\n<h4><em>&ldquo;Do you like cakes?&rdquo;</em></h4>\n<h4><em>&ldquo;Well, yes I do&rdquo;.</em></h4>\n<h4><em>&ldquo;Well&rdquo;</em>, said the voice, <em>&ldquo;there is a fine tea room too&rdquo;.</em></h4>\n<h4><em>&ldquo;What is this place?&rdquo;</em></h4>\n<h4><em>&ldquo;All I wish&rdquo;</em>, said the voice, <em>&ldquo;is that you arrive with an open mind and imagine if you will, a painting that never dries&rdquo;.</em></h4>\n<p><em></em></p>',
