                  html: '<h4>Lunch or Dinner Private Dining</h4>\n<h5>Ascend these stairs, for lunch or dinner, where three stars shine so bright...<br />An awe-inspiring menu, created by French Master Chef <a href="http://www.pierre-gagnaire.com" target="_blank" rel="noopener">Pierre Gagnaire</a>.<br />We exclusively offer private dining in the <a data-path="the-lecture-room">Lecture Room &amp; Library</a>&nbsp;for lunch and dinner...</h5>\n<h4>Lecture Room &amp; Library</h4>\n<h5>Private<br />Capacity: up to 40<br />Lunch or Dinner</h5>\n<h4>The Millicent Fawcett Room</h4>\n<h5>Dame Millicent Garrett Fawcett was a British feminist and intellectual who is primarily known for her work as a campaigner for women to be given the vote. On July 17, 1869, Dame Fawcett spoke at a public meeting held at 9 Conduit Street, calling for the enfranchisement of women. She went on to become a champion of women&rsquo;s equality.<br />Semi-private<br />Capacity: up to 8<br />Lunch or Dinner</h5>\n<h5><a href="mailto:privatedining@sketch.london" target="_blank" rel="noopener">privatedining@sketch.london</a><br /><br /></h5>',
