                  id: "3238255",
                  slug: "philanthropy",
                  html: '<h4>Philanthropy</h4>\n<h5>sketch strongly believes that businesses have a social responsibility, with this in mind we are committed to helping local communities. We have jumped on board with initiatives such as adding &pound;1.25 donations to restaurant bills... Providing support to organisations with causes too hard to ignore, <a href="https://www.place2be.org.uk/" targt="_blank">Place2Be</a> and <a href="http://www.hospitalityaction.org.uk/" targt="_blank">Hospitality Action</a>.</h5>\n<h4>As of December 2022, &pound;498,279 has been raised</h4>\n<h4>Place2Be</h4>\n<h5>Place2Be is passionate about providing a better future for children...</h5>\n<h5>Place2Be\'s highly skilled practitioners deliver emotional and therapeutic services in primary and secondary schools, building children\'s resilience through talking, creative work and play.</h5>\n<h5>Working with 257 primary and secondary schools, reaching a school population of&nbsp;105,000 children, helping them to cope with wide-ranging and often complex social issues including bullying, bereavement, domestic violence, family breakdown, neglect and trauma. To find out more about Place2Be please go to <a href="http://www.place2be.org.uk" target="_blank" rel="noopener">www.place2be.org.uk</a></h5>\n<h5><a data-modal-target="philanthropy-video">Video</a></h5>\n<h4>Hospitality Action</h4>\n<h5>Behind their smiles and slick service, restaurant workers can fall upon hard times just like the rest of us. Ours is a stressful industry, with long hours, high pressure environments and physically demanding work. Injuries, mental health problems and addiction are sadly a feature of modern restaurant life.</h5>\n<h5>For many people, retirement brings loneliness and isolation. The loss of a partner and worsening mobility only exacerbate this. Our Golden Friends befriending scheme ensures hospitality retirees always have someone to talk to and are never left feeling isolated or alone.</h5>\n<h5>That&rsquo;s where Hospitality Action steps in, they provide restaurant workers with financial, physical and psychological support to help them overcome adversity and get back to work as quickly as possible. From helping with rent payments to prevent homelessness or buying school uniforms to ensure their children stay in education they help restaurant workers stay afloat, and for those who sadly can&rsquo;t get back to work, they provide ongoing support to help them transition to the next stage of their lives. To find out more about Hospitality Action please go to <a href="http://www.hospitalityaction.org.uk/" target="_blank" rel="noopener">http://www.hospitalityaction.org.uk/</a></h5>\n<h5><a data-modal-target="philanthropy-video2">Video</a></h5>',
