                  id: "3238263",
                  slug: "cookies-policy",
                  html: '<h4>Cookies Notice</h4>\n<h5>What are cookies? Why should I care?<br />Cookies are very small text files that are saved onto your computer or handheld device when you browse websites. Like the majority of websites on the internet, we use cookies to provide you with the best experience we can. Cookies can be used by malicious websites to assist in the collection of personal or sensitive information or by sites wanting to track your movement across the internet.</h5>\n<h5>Why do sketch use cookies?<br />We use cookies to help us in numerous ways:</h5>\n<ul>\n  <li>Remember your settings throughout single and multiple visits.</li>\n  <li>Assist our marketing by understanding how you use our sites.</li>\n  <li>To improve the speed and security of the site.</li>\n</ul>\n<h5><br />What our cookies do not do:</h5>\n<ul>\n  <li>Pass personally identifiable information to third parties.</li>\n</ul>\n<h5>Are cookies spyware?<br />Cookies are not sophisticated programs such as spyware or malware. If you are worried about this kind of prying you may wish to install an anti-spyware software. These will have a function to automatically delete invasive cookies.</h5>\n<h5>Granting us permission to use cookies<br />By clicking the accept button on the Cookie Warning Prompt on our site and the continued use of the site we take to mean that you are happy with the use of cookies.</h5>\n<h5>3rd Party Cookies<br />Some of the cookies our site will store on your computer will not come directly from sketch, but rather third party services. These include:</h5>\n<ul>\n  <li>Google Analytics. Used to understand how the web site is read, which content is popular and where and how our readers visit or if they call us from our online marketing or website links. You can read the <a href="https://policies.google.com/privacy/" target="_blank" rel="noopener">Google Privacy Policy here</a>.</li>\n  <li>Google Advertising. Although we do not host advertising on the website we do allow Google Analytics to report on the data your browser collects on you. This information is in no way connected to any of our own or other 3rd party data.</li>\n</ul>\n<h5><br />Disabling these cookies will remove their functionality from the site. Google also provides a tool to <a href="https://tools.google.com/dlpage/gaoptout/" target="_blank" rel="noopener">opt-out of Google Analytics here</a>.</h5>\n<h5>Turning off cookies<br />Your browser will have settings to toggle the acceptance of cookies. Common browser settings help pages can be found here:</h5>\n<ul>\n  <li><a href="https://privacy.microsoft.com/en-GB/windows-10-microsoft-edge-and-privacy" target="_blank" rel="noopener">Microsoft Edge</a></li>\n  <li><a href="https://support.google.com/accounts/answer/61416?hl=en" target="_blank" rel="noopener">Google Chrome</a></li>\n  <li><a href="https://windows.microsoft.com/en-GB/windows-vista/block-or-allow-cookies" target="_blank" rel="noopener">Internet Explorer</a></li>\n  <li><a href="https://support.apple.com/kb/ph5042" target="_blank" rel="noopener">Safari</a></li>\n</ul>\n<h5>Turning off cookies will prevent many functions of the site including the e-commerce and social media sharing tools from providing the experience they were designed to provide.</h5>\n<h5>View our full <a data-modal-target="privacy-policy">Privacy Notice here</a>.</h5>',
