                  html: '<h3>New Year\'s Eve Celebrations<a data-modal-target="gallery-mfs-menu"></a></h3>\n<h4><strong>In the realm of pink The Gallery reigns...</strong><br />A live DJ will perform in the Gallery throughout the evening.&nbsp;</h4>\n<h4><strong style="font-size: 1em; letter-spacing: 0px;">1<sup>st</sup> sitting,</strong><span style="background-color: transparent; font-family: inherit; font-size: 1em; font-style: inherit; font-variant-ligatures: inherit; font-variant-caps: inherit; letter-spacing: 0px;"> a </span><strong style="font-size: 1em; letter-spacing: 0px;">three-course menu, </strong>including a glass of 2006 Pommery, Grand Cru, Champagne<br /><em>&pound;125 per person</em></h4>\n<h4><a href="https://indd.adobe.com/view/6a8fe901-401b-4175-9dd7-d649aa41b0b8" title="Glade New Year\'s Eve - 1st Sitting" target="_blank" rel="noopener">Gallery New Year\'s Eve Menu - 1st Sitting</a></h4>\n<h4><em>All tables are guaranteed for three hours, and diners are invited to join the Parlour or East bar afterwards on a first-come, first-served basis.</em></h4>\n<p><em></em></p>\n<h4><strong>2<sup>nd</sup> sitting</strong>, a <strong>four-course menu, </strong>including a glass of 2006 Pommery, Grand Cru, Champagne to toast the New Year<br /><em>&pound;200 per person</em></h4>\n<h4><a href="https://indd.adobe.com/view/a3d9d826-3209-43d5-82ff-5bb8dcd14371" title="Glade New Year\'s Eve Menu - 2nd Sitting" target="_blank" rel="noopener">Gallery New Year\'s Eve Menu - 2nd Sitting</a></h4>\n<h4><em>All tables will be guaranteed until close</em></h4>\n<p><em></em></p>\n<h4><strong><u>To Make a Booking<br /></u></strong><strong>Please call our reservations team</strong> on <strong>0207 659 4500</strong>. Our lines are open from 9am until 7pm daily.</h4>',
