                  id: "143686066",
                  slug: "dj-mysterydj",
                  html: "<h4><strong><u>MYSTERY DJ </u></strong></h4>\n<h5><strong>Styles covered &ndash;</strong> Afrobeat, Amapiano, German Minimal Techno</h5>\n<h6>&nbsp;This DJ can be found at London's most exclusive parties with his hip-hop and eclectic performances (recently alongside ASAP Rocky, Snoop Dogg, Zebra Katz, and Neneh Cherry to name but a few). His house and deep disco sets have reached some of the world's top international nightclubs, festivals and after-parties.</h6>\n<p></p>",
