                  id: "143703436",
                  slug: "dj-tony-coote",
                  html: "<h4><strong>TONY COOTE</strong></h4>\n<h5><strong>Styles covered &ndash;</strong> Latin &amp; Disco House, Afrobeat, Exotica, Funk, Soul &amp; Jazz, Bashment, Dancehall, Hip Hop, Reggae &amp; Re-edits</h5>\n<h6>Longtime Sketch Dj and Musician, Tony is an award-winning, experienced Dj who mixes a multitude of styles with the emphasis always on the baseline and beat. Tony is also a respected Session Drummer and Film Composer, and this informs his very musical mixing style.</h6>\n<p></p>",
