                  html: '<h3>Awards</h3><h5 class="subheading">2015</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5>Time Out Magazine &ndash; Time Out Love London Awards Winner</h5><h5 class="subheading">2014</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5>Time Out Guide &ndash; 3 Stars</h5><h5 class="subheading">2013</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5>Time Out Guide &ndash; 3 Stars</h5><h5 class="subheading">2012</h5><h5>Great Britain &amp; Ireland Michelin Guide &ndash; 2 Forks</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5 class="subheading">2011</h5><h5>Great Britain &amp; Ireland Michelin Guide &ndash; 2 Forks</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5>Time Out &ndash; featured in London&rsquo;s Hot 50 Restaurants</h5><h5>Time Out &ndash; 2 Forks</h5><h5 class="subheading">2010</h5><h5>AA Restaurant Guide &ndash; 3 Rosettes</h5><h5 class="subheading">2008</h5><h5>Great Britain &amp; Ireland Michelin Guide &ndash; 1 Star</h5><h5>Time Out &ndash; 50 Most Important Places to Eat in London</h5><h5 class="subheading">2007</h5><h5>The Square Meal Guide &ndash; 1 Stars</h5><h5 class="subheading">2003</h5><h5>Tatler - Best Room Gallery</h5>',
